Rules:
   S, Ac, A
   Ac, A, C
   A, a, 0
   B, b, 0
   C, c, 0
   Bc, B, C
 */
/*
[S]          0, 0
[ Ac A ]     1, 0  [ Ac->1 A ] 
[ A C A]     6, 2  [ Ac->2 A C ]
[ A C Bc C ] 4, 3
[ A C Bc c ] 5, 2
[ A C B C c ]4, 3
[ a C B C c ]3, 2
[ a C b C c ]2, 0
[ a C b c c ]4, 1
[ a c b c c ]
 */
use dep::std;

global N = 1024;
global K = 16;
// N_var
// global N = 32;
// K_var
// global K = 16;
global Log_Rules = 9;

global S = 1;
global Ac = 2;
global A = 3;
global C = 4;
global a = 5;
global c = 6;

global terminals = [
	a, // 0 
	c // 1
];

global non_terminals = [
	S, // 0
	Ac, // 2
	A, // 3
	C, // 4
];

global rules = [
    (S, Ac, Ac),  //0 
    (Ac, Ac, Ac), //1
    (Ac, A, C),   //2
    (A, a, 0),   //3
    (C, c, 0),   //4
    (S, A, C),  //5
];

// Just got this from noir's source code and changed the hash fn
fn compute_merkle_root_poseiden<D>(leaf: Field, index: Field, hash_path: [Field; D]) -> Field {
    let n = hash_path.len();
    let index_bits = index.to_le_bits(n as u32);
    let mut current = leaf;
    for i in 0..n {
        let path_bit = index_bits[i] as bool;
        let (hash_left, hash_right) = if path_bit {
            (hash_path[i], current)
        } else {
            (current, hash_path[i])
        };
        current = std::hash::poseidon2::Poseidon2::hash([hash_left, hash_right], 2);
    }
    current
}


struct Node {
    next: Field,
    val: Field
}

fn node_equals(node1: Node, node2: Node) -> bool {
    let bool_1 = (node1.next == node2.next);
    let bool_2 = (node1.val == node2.val);
    bool_1 * bool_2
}

struct App {
	rule: Field,
	position: Field
}




unconstrained
fn find_loc(list: [Node; N], loc: Field) -> Field {
    let mut physical_loc: Field = 0;
    let mut req_node = Node { next: -1, val: 0 };
    let mut curr_node = list[0];
    let mut traversed = 0;
    for _ in 0..N {
        if traversed == loc {
            req_node = curr_node;
        } else {
            curr_node = list[curr_node.next];
        }
        traversed += 1;
    }
    let mut counter: Field = 0;
    for i in 0..N {
        if node_equals(list[i], req_node) {
            physical_loc = counter;
        }
        counter = counter + 1;
    }
    physical_loc
}

